import React from "react";

function PrintDetails({ cityData, stateName }) {
  console.log(
    "hii ia m citydata form printdetails component",
    cityData,
    stateName
  );
  return (
    <div>
      {cityData.map((item) => {
        return (
          <h1>
            {" "}
            selected city name{item.cityName} and selected state name is :
            {stateName}
          </h1>
        );
      })}
    </div>
  );
}

export default PrintDetails;
